WOMT_aTexte['nav_werstehtzurwahl_title']=new Array();
WOMT_aTexte['nav_werstehtzurwahl_title'][0]='Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)';
WOMT_aTexte['popup_faq_1_frage']=new Array();
WOMT_aTexte['popup_faq_1_frage'][0]='Nach welchen Kriterien werden die Parteien für den Wahl-O-Mat ausgesucht?';
WOMT_aTexte['popup_faq_1_text']=new Array();
WOMT_aTexte['popup_faq_1_text'][0]='Die Bundeszentrale für politische Bildung/bpb hat alle Parteien zur Teilnahme am Wahl-O-Mat eingeladen, die von den Landeswahlausschüssen mit einer Landesliste zur Bundestagswahl 2017 zugelassen wurden. Eine Übersicht aller zugelassenen Parteien sowie eine kurze Beschreibung finden Sie auf  <a title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2017/wszw.php" target="_blank">www.wer-steht-zur-wahl.de</a>.</p><p>32 von 33 Parteien haben die Thesen beantwortet. Grundsätzlich gilt als Kriterium, dass alle Parteien und politischen Vereinigungen am Wahl-O-Mat teilnehmen dürfen, die mit einer Landesliste zur Bundestagswahl zugelassen werden. Somit können aber auch Parteien im Wahl-O-Mat auftauchen, die vom Verfassungsschutz des Bundes oder der Länder beobachtet werden und als extremistisch eingestuft werden. Welche Parteien als extremistisch eingestuft werden, können Sie auf den Seiten des Verfassungsschutzes nachlesen:</p><p>Bundesministerium des Innern:  <a title="Verfassungsschutzbericht 2016 (PDF, 3,85 MB)  (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="https://www.verfassungsschutz.de/download/vsbericht-2016.pdf" target="_blank">Verfassungsschutzbericht 2016 (PDF, 3,85 MB)</a>';
WOMT_aTexte['popup_faq_2_frage']=new Array();
WOMT_aTexte['popup_faq_2_frage'][0]='Wie ist der Wahl-O-Mat entwickelt worden? Sind die Parteien daran beteiligt gewesen?';
WOMT_aTexte['popup_faq_2_text']=new Array();
WOMT_aTexte['popup_faq_2_text'][0]='Grundlage für die Thesen im Wahl-O-Mat sind die Partei- und Wahlprogramme der Parteien sowie deren programmatische Aussagen zur Wahl. Die Thesen im Wahl-O-Mat zur Bundestagswahl wurden von einem Team aus 26 Jung- und Erstwählerinnen und -wählern zwischen 18 und 26 Jahren aus ganz Deutschland erarbeitet. Sie wurden dabei unterstützt von Wissenschaftlern und den Verantwortlichen der Bundeszentrale für politische Bildung/bpb.</p><p>In einem dreitägigen Workshop hat dieses Team 83 Thesen erarbeitet, die den Parteien zur Beantwortung geschickt wurden. Die Parteien hatten drei Wochen Zeit, alle Thesen zu beantworten. Sie wurden gebeten, die Thesen entsprechend der Parteihaltung mit "stimme zu", "stimme nicht zu" oder "neutral" zu beantworten. Außerdem konnten sie zu jeder These eine Begründung abgeben, mit der sie ihre jeweilige Positionierung ausführen und ihren genauen Standpunkt zum Themengebiet konkretisieren können. Die Thesen werden ausschließlich von den Parteien beantwortet, nur bei Unstimmigkeiten und möglichen Fehlern werden die Parteien darauf hingewiesen. Die Parteien haben aber die letzte Entscheidung über ihre Positionierungen und Begründungen im Wahl-O-Mat.</p><p>In einem zweiten Workshop wurden aus allen Thesen die 38 Thesen des Wahl-O-Mat ausgewählt. Es wurden die Thesen ausgewählt, welche die wichtigsten Themen der Wahl aufgreifen, von den Parteien kontrovers beantwortet werden, die Unterscheidbarkeit der einzelnen Parteien gewährleisten und ein breites thematisches Spektrum abdecken. Die Parteien waren an der Endauswahl der Thesen nicht beteiligt.</p><p>Weitere Hinweise zur Entstehung eines Wahl-O-Mat finden Sie unter <a title="Weitere Hinweise zur Entstehung eines Wahl-O-Mat (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.bpb.de/45292" target="_blank">http://www.bpb.de/45292</a>.';
WOMT_aTexte['popup_faq_4_frage']=new Array();
WOMT_aTexte['popup_faq_4_frage'][0]='Was kann ich antworten, wenn ich einer Aussage nur unter bestimmten Bedingungen zustimme?';
WOMT_aTexte['popup_faq_4_text']=new Array();
WOMT_aTexte['popup_faq_4_text'][0]='Wenn Sie einer Aussage nur unter bestimmten weitreichenden Bedingungen zustimmen können, antworten Sie mit "Neutral".';
WOMT_aTexte['popup_faq_6_frage']=new Array();
WOMT_aTexte['popup_faq_6_frage'][0]='Wie ist es möglich, dass ich als Ergebnis eine Partei erhalte, die ich überhaupt nicht erwartet habe?';
WOMT_aTexte['popup_faq_6_text']=new Array();
WOMT_aTexte['popup_faq_6_text'][0]='Aus unseren Nutzerbefragungen zum Wahl-O-Mat wissen wir, dass bei über 90 Prozent der Nutzer das Wahl-O-Mat-Ergebnis mit ihrer politischen Position genau oder ungefähr übereinstimmt. Nur weniger als 10 Prozent der Nutzer sind von ihrem Wahl-O-Mat-Ergebnis überrascht. Woran das im Einzelfall liegt, können wir nicht generell beantworten. Allerdings geben die 38 Thesen im Wahl-O-Mat nur einen Ausschnitt der politischen Themen wieder. Zudem gibt es zahlreiche weitere Gründe, warum Sie sich für eine Partei entscheiden können: Zum Beispiel, weil Ihnen eine Politikerin oder ein Politiker dieser Partei besonders gut gefällt, eine Partei ein für Sie besonders wichtiges Thema vertritt oder eine Partei eine Ihnen wichtige Grundanschauung teilt.</p><p>Manchmal stimmen aber auch die eigenen Einschätzungen zu einer Partei mit den tatsächlichen Positionen dieser Partei nicht überein. Nutzen Sie Ihr überraschendes Wahl-O-Mat-Ergebnis, um sich genauer mit den Positionen der Parteien auseinanderzusetzen. Sehen Sie sich auch die Begründungen der Parteien zu den Thesen an. Diese geben Ihnen ein noch genaueres Bild von der Position einer Partei.';
WOMT_aTexte['popup_faq_7_frage']=new Array();
WOMT_aTexte['popup_faq_7_frage'][0]='Warum kann es vorkommen, dass bei mir Übereinstimmungen mit einer vom Verfassungsschutz als extremistisch eingestuften Partei angezeigt werden?';
WOMT_aTexte['popup_faq_7_text']=new Array();
WOMT_aTexte['popup_faq_7_text'][0]='Es werden nur die Parteien in die Berechnung des Ergebnisses aufgenommen, die Sie zuvor ausgewählt haben. Übereinstimmungen hängen damit zusammen, dass die Mehrzahl der Thesen sachpolitische Themen zur Wahl anspricht. Bei diesen Thesen können extremistische Parteien Positionen vertreten, die mit denen anderer Parteien identisch sind. Bei einigen weiteren Thesen werden die Unterschiede zwischen diesen Parteien deutlich. Bitte schauen Sie sich an, wie die als extremistisch eingestuften Parteien speziell bei diesen Thesen geantwortet haben. Welche Parteien als extremistisch eingestuft werden, können Sie auf den Seiten des Verfassungsschutzes nachlesen:</p><p>Bundesministerium des Innern: <a title="Verfassungsschutzbericht 2016 (PDF, 3,85 MB) (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="https://www.verfassungsschutz.de/download/vsbericht-2016.pdf" target="_blank">Verfassungsschutzbericht 2016 (PDF, 3,85 MB)</a></p><p>Eine Übersicht aller zugelassenen Parteien sowie eine kurze Beschreibung finden Sie auf <a title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2017/wszw.php" target="_blank">www.wer-steht-zur-wahl.de</a>.';
WOMT_aTexte['popup_faq_8_frage']=new Array();
WOMT_aTexte['popup_faq_8_frage'][0]='Ich möchte mehr erfahren als nur das Endergebnis. Wie kann ich die Einstellungen der verschiedenen Parteien zu einzelnen Thesen erfahren und vergleichen?';
WOMT_aTexte['popup_faq_9_frage']=new Array();
WOMT_aTexte['popup_faq_9_frage'][0]='Warum kann ich maximal acht Parteien gleichzeitig in die Auswahl nehmen?';
WOMT_aTexte['popup_faq_9_text']=new Array();
WOMT_aTexte['popup_faq_9_text'][0]='Der Wahl-O-Mat ist ein Angebot zur politischen Bildung und Information, keine Wahlempfehlung. Er möchte zum einen wichtige Fragen der Wahl vorstellen und zum anderen die Auseinandersetzung der Nutzerinnen und Nutzer mit den zur Wahl zugelassenen Parteien unterstützen. Daher liegt in der Handhabung der Fokus auf der inhaltlichen Auseinandersetzung mit den einzelnen Thesen sowie mit den Parteien und deren Positionen.</p><p>Dazu gehört auch, dass die Nutzerinnen und Nutzer zunächst eigenverantwortlich eine Entscheidung darüber treffen, welche Parteien für sie von Interesse sind und sie zur Berechnung des Vergleichs auswählen wollen.</p><p>Sie können bis zu acht Parteien gleichzeitig auswählen, mit denen Sie Ihre eigenen Positionen vergleichen möchten. Die Reihenfolge der Parteien auf dieser Wahl-O-Mat-Seite richtet sich nach dem Ergebnis der letzten Wahl. Keine der Parteien wurde im Wahl-O-Mat vorab ausgewählt. Die Auswahl obliegt allein dem User und kann jederzeit über den Button "Zurück" neu ausgewählt werden.</p><p>Der Wahl-O-Mat richtet sich zudem insbesondere an Politik-Neulinge und Erst- und Jungwähler. Hier ist es besonders wichtig, zum einen die eigenständige und bewusste Auseinandersetzung zu fördern, zum anderen aber auch die Ergebnisse möglichst übersichtlich, klar strukturiert und leicht verständlich darzustellen. Dieses Ziel lässt sich mit einer selbst gewählten und immer wieder neu auszuwählenden begrenzten Anzeige der Parteien besser erreichen.</p><p>Damit Sie sich einen Überblick über alle im Wahl-O-Mat aufgeführten Parteien verschaffen können, hat die bpb zusätzlich auf der Parteien-Auswahl-Seite im Wahl-O-Mat zu jeder Partei ein Parteienprofil des bpb-Angebots "Wer steht zur Wahl" (<a title="Wer steht zur Wahl (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2017/wszw.php" target="_blank">www.wer-steht-zur-wahl.de </a>) verlinkt. So können Sie sich kurze Informationen über alle zur Wahl zugelassenen Parteien einholen und besonders über viele der kleineren Parteien mehr erfahren.</p><p>Dennoch können Sie Ihre Position mit allen Parteien im Wahl-O-Mat vergleichen:';
