WOMT_aTexte['popup_impressum_text_text'][0]='<p>Der Wahl-O-Mat zur Bundestagswahl 2017 ist ein Produkt der  <a tabindex="7" title="Bundeszentrale für politische Bildung (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.bpb.de" target="_blank">Bundeszentrale für politische Bildung/bpb</a>.</p><p>Thesen und Inhalte des Wahl-O-Mat wurden von einem Redaktionsteam aus 26 Jungwählerinnen und Jungwählern entwickelt.</p><p>Redaktionsschluss: 25. Juli 2017</p><h2>Herausgeber</h2><p>Bundeszentrale für politische Bildung/bpb, Bonn © 2017<br/>Verantwortlich gemäß § 55 RStV: Thorsten Schilling<br/><a tabindex="10" title="" href="mailto:schilling@bpb.de">schilling@bpb.de</a><br/></p><h2>Projektleitung</h2><p>Pamela Brandt<br/>Martin Hetterich<br/>Felix Riefer (Volontär)<br/><br/>Adenauerallee 86<br/>53113 Bonn<br/>Tel.: 0228 99515-0<br/>Fax: 0228 99515-405<br/>E-Mail: <a tabindex="11" title="" class="wom_link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a><br/>Internet: <a tabindex="12" title="Bundeszentrale für politische Bildung (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.bpb.de" target="_blank">www.bpb.de</a><h2>Inhalt und Redaktion</h2><p><img class="wom_pic1" alt="Gruppenfoto der Redaktion" title="Gruppenfoto der Redaktion" width="560" height="363" src="media/pix_change/pic_impressum.jpg"/><br/>Raphael Bergmann, Jonas Butz, Jimmy Dögerl, Milena Gertken, Kilian Günther, Maik Haubrich, Paul Jacobsen, Şeyda Kurt, Charline Anastasia Lelgemann, Ina Marie Leukel, Dominik Martus, Anna Meuche, Lisa Möller, Jan Morgenstern, Franziska Reuther, Pia Marie Riegger, Noah Röller, Finn Schädlich, Laura  Sprenger, Noa-Kristin Strunk, Stefanie Thölken, Ida von Holtum, Larissa Wenger, Manuel Wiemann, Nina Ziller, Simon Zotz<br/><br/>Tobias Rinn, Charlotte Roggenbuck (studentische Mitarbeiter)</p><h2>Wissenschaftliches Wahl-O-Mat-Team</h2><p>Tanja Binder, Politikwissenschaftlerin, Berlin<br/>Wolf Dittmayer, Sozial-Pädagoge und Organisationsberater, Köln<br/>Jonas Israel, Politikwissenschaftler, Heinrich-Heine-Universität Düsseldorf<br/>Prof. Dr. Stefan Marschall, Politikwissenschaftler, Heinrich-Heine-Universität Düsseldorf<br/>Gereon Schloßmacher, Journalist, Bonn</p><h2>Berater</h2><p>Vera Hanewinkel, Migrationsforscherin, Universität Osnabrück<br/>Prof. Dr. Tim Spier, Politikwissenschaftler, Universität Siegen<br/></p><h2>Umsetzung, Gestaltungskonzept & Design</h2><p>3pc GmbH Neue Kommunikation, Berlin<br/>E-Mail: <a tabindex="19" title="" class="wom_link_normal" href="mailto:info@3pc.de">info@3pc.de</a><br/>Internet: <a tabindex="20" title="3pc GmbH Neue Kommunikation (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.3pc.de" target="_blank">http://www.3pc.de</a></p><h2>Programmierung</h2><p>GLAMUS GmbH<br/>E-Mail: <a tabindex="21" title="" class="wom_link_normal" href="mailto:santo@glamus.de">santo@glamus.de</a><br/>Internet: <a tabindex="22" title="GLAMUS GmbH (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.glamus.de" target="_blank">http://www.glamus.de</a></p><h2>Nach einer Idee von</h2><p><a tabindex="23" title="ProDemos - Huis voor democratie en rechtsstaat, NL-Amsterdam (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.prodemos.nl/" target="_blank">ProDemos - Huis voor democratie en rechtsstaat</a><br/>Den Haag/Niederlande</p><p>Die Vervielfältigung, Verbreitung und die öffentliche Wiedergabe des Wahl-O-Mat ist nicht gestattet. Der Wahl-O-Mat ist urheberrechtlich geschützt.</p>';
