WOMT_aTexte['popup_faq_3_frage']=new Array();
WOMT_aTexte['popup_faq_3_frage'][0]='Wieso kommen manche wichtige Themen im Wahl-O-Mat nicht zur Sprache und wer entscheidet, welche Themen wichtig sind und welche nicht?';
WOMT_aTexte['popup_faq_3_text']=new Array();
WOMT_aTexte['popup_faq_3_text'][0]='Aus unterschiedlichen Perspektiven erscheinen unterschiedliche Themen wichtiger als andere. Regierung und Opposition, Parteien und Bürger, Medien und Wissenschaft finden unterschiedliche Themen unterschiedlich wichtig. Die Auswahl der Thesen für den Wahl-O-Mat bezieht vor allem auch die Themen mit ein, zu denen die Parteien unterschiedliche Meinungen haben und die für ein breites Spektrum von Menschen im Land von Interesse sind. Leider sind während des Entstehungsprozesses auch Thesen aus dem Wahl-O-Mat gefallen, die von bestimmten Gruppen als wichtig empfunden werden. Dies kam vor, weil die Thesen von einzelnen Parteien zu ähnlich beantwortet wurden, Thesen nur schwer verständlich waren oder andere Themen als wichtiger eingeschätzt wurden.';
