WOMT_aTexte['popup_impressum_text_datenschutz'][0]='<h1 class="wom_bigblack">Datenschutzerklärung</h1><p>Wir, die Bundeszentrale für politische Bildung/bpb als Lizenzgeber des Wahl-O-Mat und Inhaber der Domain www.wahl-o-mat.de, nehmen den Schutz Ihrer persönlichen Daten und Ihr Recht auf informationelle Selbstbestimmung sehr ernst und halten uns selbstverständlich an die datenschutzrechtlichen Regeln. <br/>Als öffentlich-rechtliche Stelle des Bundes unterliegen wir den Bestimmungen des Bundesdatenschutzgesetzes, dessen Zweck der Schutz vor Beeinträchtigungen des Persönlichkeitsrechts durch den Umgang mit personenbezogenen Daten ist.</p><p>Die Bundeszentrale für politische Bildung/bpb hat technische und organisatorische Maßnahmen getroffen, die sicherstellen, dass die Vorschriften über den Datenschutz sowohl von uns als auch von externen Dienstleistern beachtet werden.</p><h2>Zugriff auf die Seiten von wahl-o-mat.de</h2><p>Jeder Zugriff auf unsere Homepage und jeder Abruf einer auf der Homepage hinterlegten Datei werden protokolliert. <br/>Die Speicherung dient internen systembezogenen und statistischen Zwecken. Protokolliert werden: Name der abgerufenen Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge, Meldung über erfolgreichen Abruf, Webbrowser und anfragende Domain. Die IP Adressen der anfragenden Rechner werden anonymisiert protokolliert, eine Rückverfolgung ist nicht möglich. Die Logfiles selbst werden maximal vier Wochen gespeichert, sie werden monatlich automatisch gelöscht.</p><h2>Personenbezogene Daten</h2><p>Personenbezogene Daten sind Informationen zu Ihrer Person, die dazu genutzt werden können, Ihre Identität zu erfahren - etwa Ihren richtigen Namen, Ihre Adresse, Postanschrift oder Telefonnummer. Informationen, die keine Rückschlüsse auf eine bestimmte oder bestimmbare Person zulassen, fallen nicht darunter.</p><p>Bei der Nutzung des Wahl-O-Mat werden keinerlei personenbezogene Daten erhoben.</p><p>In keinem Fall werden die erhobenen Daten verkauft oder aus anderen Gründen an Dritte weitergegeben. Sie werden nur zur unmittelbaren Erfüllung des Zweckes verwendet, für die wir die Daten benötigen, und sind auch nur den Personen zugänglich, die unmittelbar zur Erfüllung dieses Zweckes Zugriff auf sie haben müssen.</p><p>Soweit Fremdfirmen im Auftrag der Bundeszentrale für politische Bildung tätig werden - etwa, um den Server der Webseite zu pflegen -, werden diese Firmen ausdrücklich darauf verpflichtet, die Daten ausschließlich im Rahmen dieser Zweckbestimmung zu verwenden und anschließend - nach Ablauf eventuell bestehender gesetzlicher Fristen - zu löschen.</p><h2>Cookies</h2><p>Der Wahl-O-Mat verwendet insgesamt zwei sogenannte Cookies. Sie dienen dazu, sicherzustellen, dass ein und derselbe Nutzer nicht mehrmals in unserer Nutzungsstatistik gezählt wird. Cookies sind kleine Textdateien, die auf Ihrem Rechner abgelegt werden und die Ihr Browser speichert. Cookies richten auf Ihrem Rechner keinen Schaden an und enthalten keine Viren. Der Wahl-O-Mat funktioniert auch ohne Cookies.</p><h2>Umfrage</h2><p>Am Ende des Wahl-O-Mat wird einer zufälligen Auswahl von Nutzerinnen und Nutzern die Möglichkeit angeboten, an einer wissenschaftlichen Evaluation des Wahl-O-Mat teilzunehmen. Die Teilnahme ist freiwillig, die Umfrage ist anonym, d.h. bei ihr werden ebenfalls keine personenbezogenen Daten erfasst. <br/>Auf der Seite <a tabindex="103" title="Universität Düsseldorf (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.wahl-o-mat.uni-duesseldorf.de" target="_blank">www.wahl-o-mat.uni-duesseldorf.de</a> können Sie die Ergebnisse der Evaluationen einsehen.</p><h2>Datenschutzerklärung für die Nutzung von Twitter, Facebook und WhatsApp</h2><p>Auf <a tabindex="104" title="www.wahl-o-mat.de (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="https://www.wahl-o-mat.de" target="_blank">www.wahl-o-mat.de</a> wird zur Einbindung von Social Media-Funktionalitäten der Shariff-Button von heise.de eingesetzt, der den direkten Kontakt zu Facebook, Twitter und WhatsApp erst dann herstellt, wenn der Anwender aktiv auf den Share-Button klickt. Wir weisen darauf hin, dass wir als Anbieter der Seite www.wahl-o-mat.de keine Kenntnis vom Inhalt der übermittelten Daten sowie deren Nutzung von Facebook, Twitter und WhatsApp erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerklärung der jeweiligen Anbieter.</p><h2>Kooperationspartner</h2><p>Diese Datenschutzerklärung gilt nur für den Server von www.wahl-o-mat.de. Der Wahl-O-Mat wird jedoch auch von Kooperations- und Medienpartnern der bpb auf deren eigenen Servern betrieben. Auf diesen kann es andere Datenschutzrichtlinien geben. <br/>Die bpb übernimmt keine Verantwortung für die Datenschutzrichtlinien dieser externen Webseiten.</p><p>Kooperations-/Medienpartner der bpb stellen der bpb lediglich täglich die Zahl der insgesamt erfolgten Nutzungen des Wahl-O-Mat auf deren Servern zu, die in die Nutzungsstatistik auf <a tabindex="109" title="www.wahl-o-mat.de/bundestagswahl2017 (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="https://www.wahl-o-mat.de/bundestagswahl2017/" target="_blank">www.wahl-o-mat.de</a> eingehen.</p><h2>Auskunftsrecht</h2><p>Sie haben jederzeit das Recht auf Auskunft über die bezüglich Ihrer Person gespeicherten Daten, deren Herkunft und Empfänger sowie den Zweck der Speicherung. Auskunft über die gespeicherten Daten gibt die Datenschutzbeauftragte der Bundeszentrale für politische Bildung:  <a title="" class="wom_link_normal" href="mailto:diehl@bpb.de" tabindex="110">diehl@bpb.de</a>.</p><h2>Fragen und Kommentare</h2><p>Wenn Sie Fragen haben, die diese Datenschutzerklärung nicht beantworten konnte, wenn Sie zu einem Punkt weitere Informationen haben möchten oder Anregungen oder Kommentare haben, können Sie sich gern direkt per E-Mail an die Datenschutzbeauftragte der Bundeszentrale für politische Bildung wenden: <a tabindex="111" title="" href="mailto:diehl@bpb.de">diehl@bpb.de</a>.</p><p>Bonn, den 30. August 2017</p>';
