WOMT_aTexte['popup_faq_10_frage']=new Array();
WOMT_aTexte['popup_faq_10_frage'][0]='Wie berechnet der Wahl-O-Mat das Ergebnis?';
WOMT_aTexte['popup_faq_10_text']=new Array();
WOMT_aTexte['popup_faq_10_text'][0]='Der Wahl-O-Mat berechnet die Übereinstimmung sowie die Nähe der Positionierung der Nutzerinnen und Nutzer zu den Positionierungen der Parteien. Bei einer exakten Übereinstimmung von Nutzer- und Parteiposition vergibt der Wahl-O-Mat zwei Punkte, bei gegensätzlichen Positionen keinen Punkt. Bei einer Annäherung der Position der Nutzerin bzw. des Nutzers an die Position der Partei vergibt der Wahl-O-Mat einen Punkt, d.h. wenn z. B. die Partei mit "Neutral" stimmt und der Nutzer bzw. die Nutzerin mit "Stimme zu" oder "Stimme nicht zu".</p><p>Wird eine These gewichtet, dann fließt diese These mit dem doppelten Wert in die Berechnung ein. Überspringt der Nutzer eine These, dann fällt diese These aus der Berechnung heraus.</p><p>Der Wahl-O-Mat zeigt im Ergebnis an, welcher prozentuale Anteil der maximal möglichen Punktzahl für die Übereinstimmung mit einer Partei erreicht wurde. Die maximal mögliche Punktzahl kann je nach Anzahl der gewichteten und übersprungenen Thesen unterschiedlich sein.</p><p>Eine Übersicht zur Berechnungsmethode und Beispielrechnungen finden Sie unter <a title="Übersicht zur Berechnungsmethode und Beispielrechnungen (Dieser Link öffnet sich in einem neuen Fenster.)" class="wom_link_normal" href="http://www.bpb.de/187657" target="_blank">http://www.bpb.de/187657</a>';
WOMT_aTexte['3_text_partei_close']=new Array();
