WOMT_aTexte['popup_faq_11_frage']=new Array();
WOMT_aTexte['popup_faq_11_frage'][0]='Bietet der Wahl-O-Mat eine Vorlesefunktion?';
WOMT_aTexte['popup_faq_11_text']=new Array();
WOMT_aTexte['popup_faq_11_text'][0]='Die Vorlesesoftware Readspeaker liest Ihnen die Texte im Wahl-O-Mat vor, dafür müssen Sie keine zusätzliche Software herunterladen. Dieser Dienst verbessert die Zugänglichkeit der Inhalte und ist eine Hilfestellung für Nutzerinnen und Nutzer, die Probleme beim Lesen von Onlinetexten haben.</p><p>Auf der linken Seite des Wahl-O-Mat, bzw. bei mobilen Geräten im Menü am Ende des Wahl-O-Mat, finden Sie ein entsprechendes Symbol sowie den Hinweis "Vorlesefunktion aktivieren". Nach der Aktivierung können Sie den Text zur entsprechenden Seite anhören. Sie können mit Hilfe der Steuerung die Vorlesefunktion pausieren und fortsetzen, stummschalten oder zum vorherigen bzw. nächsten Vorlesetext springen.</p><p>Ihr individuelles Wahl-O-Mat Ergebnis und die danach folgenden Begründungen der Parteien können Sie jedoch nur sehen, nicht hören. Das Vorlesen Ihres Ergebnisses und die daraus entstehende Reihenfolge der Parteibegründungen würde bedeuten, dass wir Ihre Daten an einen Drittanbieter senden müssten. Um Ihre Daten zu schützen, haben wir darauf verzichtet.<br/>';
